import "../../../Styles/Pages/Games/GamesCategories.scss";

function GamesCategories() {
  return (
    <div className='gamesCategories'>
      <div className='category__one'>
        <h3> Category </h3>
      </div>
    </div>
  );
}

export default GamesCategories;
